import RDSMonitor from './components/RDSMonitor'
import './App.css';
import {BrowserRouter as Router, Route, Link} from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Router>
          <ul>
            <li><Link to="/account1">Account1</Link></li>
            <li><Link to="/account2">Account2</Link></li>
            <li><Link to="/account3">Account3</Link></li>
          </ul>
          <Route path="/account1" component={RDSMonitor} />
          {/* <Route path="/account2" />
          <Route path="/account3" /> */}
        </Router>
      </header>
      <div>
        <RDSMonitor account_name="ACCOUNT1"></RDSMonitor>
        <RDSMonitor account_name="ACCOUNT2"></RDSMonitor>
      </div>
    </div>
  );
}

export default App;
